Spidersense-worker
Returns the following JSON =>
<testcase_name>: [
{
testcaseId: string,
signature: string,
passed: number (0|1)
}, ...
]
}, ...
Note that this object has key(s) that are the testcase names themselves.

(1) Reformat the response so that we get a list of objects, each with a single key matching the testcase name (rather than a single object with each key being the testcase names).
[
{
TestDataBuilder: [
{
testcaseId: 10343,
signature: test-name,
passed: 0
},....
]
}, ...
]
(2) Get handle on directoryContainer and bind the child divs to the data above. Set class attribute .sourceNameContainer for each div.
(3) There are two sets of checkboxes in this view: one tied to the source name, which when checked will check all testcases for that source file, and another tied to each individual test case.
Source name 1 => label and input
test case id 1 => label and input
test case id 2 => label and input
test case id 3 => label and input
Source name n
test case id n
The input for the source will have its key attribute set to the source name.
Each input for the test cases will have its key attribute set to the respective testcaseid.
(4) Add Pass or Fail status indicator for each testcase, highlighting passed as green and failed as red.
(5) Update state
- testcases: [
{
testcase_name: [
{
testcaseId: string,
signature: string,
passed: number (0|1)
}, ...
]
}, ...
]
(6) Add click listeners for checkboxes
Again, 2 kinds: one for the source name, and one for each individual testcases.

(1) Create a new Suspiciousness object (from suspiciousness module), and pass it the response. Call .suspiciousness() to get back the fault localization data.
