Spidersense-worker
Returns the following JSON =>
testcases: [
{
signature: string,
sourceName: string
passed: number (0|1)
coverage: [
{
line: {
lineId: string,
lineNumber: number,
sourceName: string
}
}, ...
]
}
]
Note that Promise.all() is used, so that this single testcases object will be returned as an array to hold multiple responses.

